#root.root {--toolbar-bg: #400080ff;}
#root.root {--frame-bg: #400040ff;}


#root[data-color-scheme=dark]{
	--toolbar-bg:        hsl(252, 4%, 10%);
	--frame-bg:          hsl(252, 4%, 6%);
	--hover-bg:         hsla(252, 4%, 100%, 8%);
	--active-bg:         hsl(252, 4%, 4%);
	--tabs-activated-bg: hsl(252, 4%, 18%);
	--selected-bg:       hsl(252, 4%, 20%);
	--ctx-menu-bg:       hsl(252, 4%, 9%);
	--ctx-menu-separator:hsl(252, 4%, 15%);
	--popup-bg:          hsl(252, 4%, 9%);

	--tabs-activated-shadow: 0 1px 4px -1px rgba(0,0,0,0.282);
	--ctx-menu-shadow: 0 0 0 1px var(--ff-popup-border,black), 0 1px 16px 0 rgba(0,0,0,.7);
}

 .panel-box > div{ min-width: 60px }
